sys_variable_value.value:
(function execute(inputs, outputs) {

gs.include("ethjs-format");
gs.include("object-assign");

var payload = JSON.parse(inputs.payload);

if (payload.to == "")  { delete payload.to }
if (payload.gas == "")  { delete payload.gas }
if (payload.gasPrice == "")  { delete payload.gasPrice }
if (payload.value == "")  { delete payload.value }
if (payload.nonce == "")  { delete payload.nonce }




var payload2 = ethFormat.formatInputs('eth_call', [payload])[0];

outputs.payload2 = JSON.stringify(payload2);

})(inputs, outputs);

